class.doc:
A more flexible implementation of the SLF4j message formatter (org.slf4j.helpers.MessageFormatter). the following improvements:
1) Allow to format to a procvided destination (Appendable) allowing you to reduce the amount of garbage generated in a custom formatter... 2) Lets you know which arguments have been used in the message allowing you to implement extra logic to handle the unused ones 3) Lets you plug custom formatters for argument types. (you can get better performance and more flexibility) 4) Processing arguments that are arrays is sligtly faster than the slf4j formatter.
@author zoly

